{{About|||Hema (disambiguation)|and|Hima (disambiguation)}}
The '''Hema''', or '''Hima''', are an ethnic group with about 160,000 members located in the eastern [[Democratic Republic of the Congo]], in particular the [[Ituri region]] and [[Orientale Province]], as well as parts of [[Uganda]] and [[Rwanda]]. The Hema are [[pastoralism|pastoralists]] and the preferential treatment given to them by Ugandan officials is blamed for igniting the recent [[Ituri conflict]].

The northern Hema speak [[Lendu language|Lendu]], the language of the neighbouring [[Lendu]] people. The southern Hema still speak [[Hema language|Hema]], a [[Bantu language|Bantu]] language, and the closely related Hima dialect of [[Nyankore language|Nyankore]] of western Uganda, which are also related are such languages as [[Luganda]] and [[Lusoga]]. Most Hema are [[Christianity|Christians]].<ref>[http://www.joshuaproject.net/people-profile.php?peo3=15015&rog3=CG Hema]</ref>

